from typing import List
from sortedcontainers import SortedList

class Solution:
    def minOperations(self, nums1: List[int], nums2: List[int], k: int) -> int:
        diffSum = 0
        diffMax = float('-inf')
        sl = SortedList()
        for a, b in zip(nums1, nums2):
            diffSum += (a - b)
            diffMax = max(diffMax, abs(a - b))
            sl.add(a-b)
        if diffSum != 0:
            return -1
        #print(sl)
        cnt = 0
        i, j = 0, len(sl) - 1
        while True:
            factor = min(abs(sl[i])//k, abs(sl[j])//k)
            #print(f'\tfactor = {factor}')
            tmp1 = sl[i] + k * factor
            tmp2 = sl[j] - k * factor
            # update sl
            del sl[i]
            sl.add(tmp1)
            del sl[j]
            sl.add(tmp2)
            cnt += factor
            #print(f'\tsl = {sl}')
            if min(sl) == 0 and max(sl) == 0:
                break
        #print(cnt)
        #return diffMax // k
        return cnt

